          <input style={{ width: "50%", left: "25%", maxWidth: 600, minWidth: 400, height: 30, borderRadius: 20, 
                  boxShadow: '0px px 10px 10px #00000010', padding: 10, paddingLeft: 20, paddingRight: 20,
                  fontSize: 20, border: "1px solid #cecece"
                }} type="text" placeholder="Search user stories ..." />
          </div>
          <div style={{ fontsize: 10, fontWeight: 'normal' }}>
            powered by Frank Frisby and data source: GPT-3
          </div>
        </div>
    </div>
  );
}

export default App;
